import './styles/NavBar.module.css'

type Props = {}

export const NavBar = (props: Props) => {
  return (
    <div className="navbar">
      <ul>
        <li><img src={require('./images/home.svg').default} alt="home-logo" /></li>
        <li><img src={require('./images/user.svg').default} alt="user-logo" /></li>
        <li><img src={require('./images/search.svg').default} alt="fav-logo" /></li>
        <li><img src={require('./images/fav.svg').default} alt="loupe-logo" /></li>
        <li><img src={require('./images/add.svg').default} alt="add-logo" /></li>
      </ul>
    </div>
  )
}
